import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Main from './main/main';
import "./component/ui/Main/buttonMain"
import "./component/ui/Main/buttonMainMov"
import CreacteUser from './modulos/user/createUser';
import DelectUser from './modulos/user/delectUser';
import UpdateUser from './modulos/user/updateUser';
import ShowListUser from './modulos/user/showListUser';
import ShowUser from './modulos/user/showUser';
import axios from 'axios';
import VistaPrin from './modulos/Principal/principal';
import { useEffect, useState } from 'react';
import { builtRouter } from './builtRoter/builtRouter';

const URI = 'http://localhost:8000/valUser';

function App() {
  const [valInic, setValInic]  = useState('') 
  let [vistPag, setVistPag]  = useState('') 

  const builtVist = async () => {
    let bultPag
    bultPag = builtRouter(valInic);
    setVistPag(bultPag)
  }

  const getValInicUser = async () => {   
    const request  = await axios.get(URI)
    setValInic(request.data.statusUser)
  }
  useEffect(() => {
    getValInicUser()
  },[])
  useEffect(() => {
    builtVist()
  },[valInic])
  return (<>
      {vistPag}
  </>);
}

export default App;
